  \"2013-03-15T10:46:10.282913\",\n\t\"name\": \"spatial-vegetation-data-for-richmond-national-battlefield-park-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This shapefile is an vegetation map of
  Richmond National Battlefield Park, Virginia. It was developed by The Virginia Department
  of Conservation and Recreation, Division of Natural Heritage in cooperation with
  North Carolina State University's Center for Earth Observation for the Northeast
  Region of the National Park Service. The data was created following general guidelines
  set forth by the USGS-NPS Vegetation Mapping Program. Map classes are crosswalked
  to the U.S. National Vegetation Classification (USNVC) or level II of the Andersons
  land use land cover classification system. Crosswalks to the USNVC were determined
  on September 27, 2007. The map is based on field work performed in the summer of
  2002-2006 and photo interpretation of aerial photo mosaics produced by North Carolina
  State University Center for Earth Observation from photography obtained in October
  2001 and February 2002.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
